import { Link } from "react-router-dom";

function Home() {
  return (
    <div class="bg-slate-600">
      <h1>This is the home page</h1>
      <Link to="about">About Page</Link>
      <Link to="contact">Contact Page</Link>
    </div>
  );
}

export default Home;
